notes:
- Some sensors may not report values under certain conditions
- Peripheral IO may have limitations based on device capabilities
- The privilege is essential part to get access grant for privacy related data or
  sensitive system resources.
- Tizen has expanded its horizon from smart devices to IoT devices.
- Tizen 5.0 provides APIs such as Tizen Interface Definition Language (TIDL) and RPC-port
  for easy integration of various kinds of services such as SmartThings.
- Tizen 3.0 adopts various new features such as high performance graphics, latest
  web technologies, intensified security, and multi-user support.
- Tizen 3.0 supports multiple device profiles, each optimized for the device category
  taking care of diverse requirements for display, connectivity, user-interface, sensors,
  health, security, memory, and performance requirements.
- It is best practice to always have a maintainer role for every Tizen project, and
  maintainers must submit packages to OBS as soon as all merged packages are ready
  for submission, in order to prevent possible omissions.
- GBS and MIC are used as examples because they are mandatory development tools for
  Tizen developers.
- If an error message is shown when you click the link in the verification email,
  copy the link to the address bar of the browser manually.
- The file contains the GBS configuration for latest profiles and repositories.
- The default GBS build parameters are based on the profile 'unified_standard'.
- This repo tool is launched for Python 3.6 and higher version only.
- If your environment is lower than Ubuntu 16.04 with Python 3.5.2 version, you can
  encounter some problems while launching the repo tool.
- You can only contribute code to Tizen using the SSH protocol.
- Create a <Specific_Project>/.gbs.conf GBS configuration file for customization
- If new packages to be built are dependent on previously built packages, use the
  appropriate gbs build command
- To speed up the build process when hardware allows, see Speeding up a Local Build.
- The baseurl property of the local repo specifies the file path where locally built
  RPMs are located.
- Setting the priority of the local repository at 1 and the priorities of remote repositories
  at 99 guarantees that MIC uses the packages that exist in the local repository with
  a higher priority when packages are available in both remote and local repositories.
- TIC is an image creator tool used to create images for Tizen.
- Supports YAML style recipe.
- Raspberry Pi 3 was not supported since Tizen 8.0.
- Raspberry Pi 5 (64bit-only) can be used for experimental purposes.
- Before using a UART-to-USB dongle, familiarize yourself with any hardware limitations
  it has by visiting the manufacturers website.
- If Ethernet ports are not available in the host computer or the Raspberry Pi, you
  can also use an Ethernet-to-USB dongle.
- '`sdb` execution file is available in the tools sub-directory of the directory where
  Tizen Studio is installed.'
- Bluetooth supports version 5.0 and multiple profiles including GATT, FTP, OPP, MAP,
  PBAP, A2DP, AVRCP, HSP/HFP, RFCOMM, HID, HDP, and PAN.
- Tizen uses INOTIFY instead of DNOTIFY. You must disable DNOTIFY from your kernel
  configuration.
- Tizen supports the Extended 4 (Ext 4) file system as the default file system.
- To use the resourced freezer feature, you must install the freezer plugin by enabling
  CONFIG_FREEZER.
- The sensor server is responsible for initializing the sensors during boot.
- Hardware sensors must support the HAL.
- The sensorhub HAL can operate each sensor as a logically-separate device.
- crash-manager is automatically invoked by the kernel when an application crashes.
- Default configuration files are located in /etc/crash-manager.conf and /etc/minicoredumper/minicoredumper.cfg.json.
- Configuration files are merged together and not replaced.
- Program name must be application ID for applications and executable name for other
  system processes.
- Chipset vendors have to provide their own backend modules in order for TBM to work
  well on the Tizen platform.
- The TDM backend module must define the global data symbol with the name `tdm_backend_module_data`.
- The display backend interface is mandatory.
- The output backend interface is mandatory.
- The HWC backend interface is mandatory.
- The hwc window backend interface is mandatory.
- The layer backend interface is mandatory.
- Uses Tizen Porting Layer for EGL  requires setup of native display and surface.
- Waylandsink for Tizen uses TBM Video Format to support various video formats.
- The use-tbm property is true by default.
- Tizen supports Bluetooth version 4.2.
- Tizen uses wpa_supplicant as the platform interface to Wi-Fi devices.
- HERE Maps plugin is embedded in the platform with provider name 'HERE'
- User consent application is launched the first time the user attempts to access
  map services
- OEM vendors can port available plugins within Telephony as needed to support specific
  hardware.
- You can use various command attributes to manage command line tools.
- GBS divides packages into native and non-native categories based on control of the
  source code repository.
- In non-native packages, tracking local modifications is crucial.
- Upstream branch must be configured for GBS to recognize non-native packages.
- The use of the pristine-tar tool is optional, but highly recommended.
- GBS supports two different maintenance models for non-native packages.
- Currently, GBS automatically merges the new upstream version to your master branch.
- The use of the `pristine-tar` tool is optional, but highly recommended.
- If you are planning to use this feature, configure it in the package-specific .gbs.conf
  file. This way, all users (including the automatic build machinery) build and export
  the package in a similar way.
- First time running tp, create default config...
