- Failed to create an image when password in the repository URL contains '@'
- Tizen Studio is an open-source project.
- 'You can develop various extensions for the emulator: QEMU, kernel, Emulator Manager,
  and Emulator Control Panel extensions.'
- TS-CLI is only supported on 64-bit Ubuntu.
- Ensure your host machine is behind the proxy server and uses special DNS.
- Getting binaries and images available at the specified base URL.
- Open Source upgrades include various library versions
- New features and changes have been made across multiple frameworks
- Raspberry Pi 5 board should have EEPROM version 2013-12-06.
- Some APIs with low usability have been deprecated.
- Deprecated legacy face, image, surveillance APIs.
- Tizen 8.0 M1 source codes are under tizen_8.0 branch.
- Kernel feature kfence, a sampling-based memory safety error detector, support with
  CONFIG_KFENCE on Raspberry Pi 4.
- Unified resource monitor framework and capi-system-resource-monitor have been added
  to monitor the various resource status.
- New API and features added for various components.
- Improvements and fixes in the application framework and multimedia framework.
- Kernel for Raspberry Pi 4 has been upgraded to version 5.10.25.
- Filesystem compression (SquashFS) has been applied to the ramdisk partition.
- Kernel upgrade for Raspberry Pi 4 has been upgraded to version 5.4.50.
- 64Bit Kernel and Boot for Raspberry Pi 4 has been supported.
- The Tizen 5.5 Public M3 release provides new features for wearable, such as AOD
  viewer, Sticker framework, Aurum for UI test automation, and battery-monitor framework.
- OS upgrade from Tizen 4.0 to Tizen 5.5 has been supported.
